export default function SignUp(){
    return(
        <div class="signUp">
        <h3>
          REGISTER TODAY!
        </h3>

        <form>
          <input
            value={name}
            onChange={(e) => setName(e.target.value)}
            type="text"
            placeholder="name"
          />
          <br></br>
          <input
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            type="text"
            placeholder="email"
          />
          <br></br>
          <input
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            type="text"
            placeholder="password"
          />
        </form>
        <br/>
        <button>
          Submit
        </button>

      </div>
    );
}
